	function getLodsLuaTableString(lod_table)
		local str = "LOD_MAP_NEW = {"
		local countLine = 0
		for k, v in pairs(lod_table or LOD_MAP_NEW) do
			if countLine == 10 then
				str = str:sub(1, -2) .. "\n"
				countLine = 0
			end
			str = str .. "[" .. k .. "] = " .. v .. ", "
			countLine = countLine + 1
		end
		str = str:sub(1, -3) .. "}"
		return str
	end
	
	function getLODModelFromObjectModel(model)
		if type(model) ~= "number" then return end
		return LOD_MAP_NEW[model]
	end